import 'package:library_reservation/core/model/update_entity.dart';updateEntityFromJson(UpdateEntity data, Map<String, dynamic> json) {	if (json['download-url'] != null) {		data.downloadUrl = json['download-url'].toString();	}	if (json['version'] != null) {		data.version = UpdateVersion().fromJson(json['version']);	}	return data;}Map<String, dynamic> updateEntityToJson(UpdateEntity entity) {	final Map<String, dynamic> data = new Map<String, dynamic>();	data['download-url'] = entity.downloadUrl;	data['version'] = entity.version?.toJson();	return data;}updateVersionFromJson(UpdateVersion data, Map<String, dynamic> json) {	if (json['code'] != null) {		data.code = json['code'] is String				? int.tryParse(json['code'])				: json['code'].toInt();	}	if (json['desc'] != null) {		data.desc = json['desc'].toString();	}	if (json['name'] != null) {		data.name = json['name'].toString();	}	return data;}Map<String, dynamic> updateVersionToJson(UpdateVersion entity) {	final Map<String, dynamic> data = new Map<String, dynamic>();	data['code'] = entity.code;	data['desc'] = entity.desc;	data['name'] = entity.name;	return data;}